import React, { Component } from 'react'

// Components 
import Header from './../Header/Header'
import Routers from './../H/Routers'
import Footer from './../Header/Footer'

const Layout = () => {
  return (
    <>
      <Header />
      <Routers />
      <Footer />
    </>
  )
}

export default Layout
